import React from 'react';
import styled from "styled-components"


const Calculator = () => {
    return(
        <Wrapper>
            <AnswerBlock>
                <GetNumbers>
                    2
                </GetNumbers>
                <Answer>
                    1
                </Answer>
            </AnswerBlock>
            <FLexContainer>
                    <RowBock>
                        <h3>AC</h3>
                        <h3>Back</h3>
                        <h3>%</h3>
                        <h3>/</h3>
                    </RowBock>
                    <RowBock>
                        <h3>7</h3>
                        <h3>8</h3>
                        <h3>9</h3>
                        <h3>*</h3>
                    </RowBock>
                    <RowBock>
                        <h3>4</h3>
                        <h3>5</h3>
                        <h3>6</h3>
                        <h3>-</h3>
                    </RowBock>
                    <RowBock>
                        <h3>1</h3>
                        <h3>2</h3>
                        <h3>3</h3>
                        <h3>+</h3>
                    </RowBock>
                    <RowBock>
                        <h3>.</h3>
                        <h3>0</h3>
                        <h3 style={{width: "100%"}}>=</h3>
                    </RowBock>
                </FLexContainer>
        </Wrapper>
    );
}
const Wrapper = styled.div`
    position: relative;
    width: 400px;
    height: 600px;
    background: #cee2f3;
    border: 0.5px solid black;
    padding: 25px;
`;
const AnswerBlock = styled.div`
    height: calc(100% / 5);
    width: 100%;
    background: white;
    border: 0.5px solid black;
    display: flex;
    flex-direction: column;
    align-items: flex-end;
    justify-content: center;
    color: black;
`;
const GetNumbers = styled.div`
    width: calc(100% / 2);
    height: 40px;
    text-align: center;
    padding-top: 10px;
`;
const Answer = styled.div`
    width: calc(100% / 2);
    height: 40px;
    padding-top: 10px;
    text-align: right;
    padding-right: 15px;
`;

const FLexContainer = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    margin-top: 10px;
`;
const RowBock = styled.div`
    display: grid;
    grid-template-columns: repeat(4, calc(((400px / 4) - 21px)));
    margin-top: 25px;
    grid-column-gap: 10px;

    &:last-child {
        border: 0.5px solid yellow;
    }

    h3 {
        border: 1px solid black;
        text-align: center;
        padding: 20px 0px 20px 0px;
        background: white;
    }
`;
export default Calculator
